import React from 'react';

type ButtonType = {
name:string;
started:()=>void
}


export const Button = (props:ButtonType) => {
    const Started = ()=>{
        props.started()
    }
    return (
<span>
     <button onClick={Started}>{props.name}</button>
</span>


    );
};
